import React from "react";
import "./Listitem.css";
import danAbramovImage from '../../../assets/images/danabramov.jpg'
const ListItem = () => (
  <li className="ListItemWrapper">
    <img src={danAbramovImage} />
    <div>
      <h2>Dan Abramov</h2>
      <p></p>
      <button>visit twitter Page</button>
    </div>
  </li>
);
export default ListItem;
